  {name: "Snowbombing 2018", latitude: 47.1681071, longitude: 11.8618122, start_date: "2018-04-04", end_date: "2018-04-09", date: "April 4-9, 2018", location: "Mayrhofen, Austria", city: "Mayrhofen", state: "Tyrol", country: "AT", website: "http://www.snowbombing.com/", description: "Nobody knows how to apres-ski like the europeans which means snowbombing is the ultimate on-the-hill music festival. the austrian resort of mayrhofen plays host to the madness of a full week of snowboarding, electronic music, and partying in the alps. ", price: 0, camping: " No"},
  {name: "Rhythm N Blooms 2018", latitude: 35.9606384, longitude: -83.9207392, start_date: "2018-04-08", end_date: "2018-04-10", date: "April 8-10, 2018", location: "Knoxville, TN", city: "Knoxville", state: "TN", country: "US", website: "http://www.rhythmnbloomsfest.com/", description: "Set amidst the urban artistic cityscape of the ever-growing jackson avenue in knoxville, tennessee from april 10-12, rhythm n’ blooms celebrates the crossroads of knoxville’s varied musical history. this american roots music festival spotlights storied songwriters and rich performances from jazz to world-class bluegrass to indie – and everything in between.", price: 0, camping: " No"},
  {name: "Caprices Festival 2018", latitude: 46.30762, longitude: 7.47370999999998, start_date: "2018-04-07", end_date: "2018-04-10", date: "April 7-10, 2018", location: "Crans-Montana, Switzerland", city: "Montana", state: "VS", country: "CH", website: "http://www.caprices.ch/en/", description: "You know the drill. ski and snowboard all day, then party all night with cutting-edge edm artists from around the world. okay, you might be partying all day as well in a transparent mountain-top tent that shows off the jaw-dropping swiss alps. rest up before you go because sleep is not an option at caprices", price: 0, camping: " No"},
