  {name: "Old Settler’s Music Festival 2018", latitude: 30.123275, longitude: -98.0315889, start_date: "2018-04-14", end_date: "2018-04-17", date: "April 14-17, 2018", location: "Driftwood, TX", city: "Driftwood", state: "TX", country: "US", website: "http://www.oldsettlersmusicfest.org/", description: "Old settler's music festival is a nationally known music festival featuring the best in roots and americana music. the festival is held in the gorgeous texas hill country, at the height of the bluebonnet and wildflower season. old settler's music festival offers great music and activities for the whole family.", price: 0, camping: " Yes"},
  {name: "Coachella Music Festival 2018", latitude: 33.7205771, longitude: -116.2155619, start_date: "2018-04-15", end_date: "2018-04-24", date: "April 15-24, 2018", location: "Indio, CA", city: "Indio", state: "CA", country: "US", website: "http://www.coachella.com/", description: "Like a barometer always reading a temperature of awesome, the traditional kickoff to the summer festival season is dominated by coachella. the glitz and glamour of los angeles migrates east to the indio desert for back to back weekends of the biggest names in music. what started as a small electronic festival in the desert has transformed into a cultural touchstone for the festival season.", price: 0, camping: " Yes"},
