  {name: "Melt! Festival 2018", latitude: 51.7582836, longitude: 12.4471383, start_date: "2018-07-15", end_date: "2018-07-17", date: "July 15-17, 2018", location: "Ferropolis, Germany", city: "Gräfenhainichen", state: "SA", country: "DE", website: "http://www.meltfestival.de/", description: "Melt! from a distance: a bright ball of fire, a burning inferno, surrounded by the lake gremmin and the silence of the night. indescribably beautiful. up close, revealed an extraordinary microcosm between loud and quiet, guitars and beats, industry and nature. melt! puts together what belongs together only at this magical place ferropolis - the city of iron. and when the sun rises between the steel giants, which once supplied the east of germany with coal, we all get this melt! feeling.", price: 0, camping: " Yes"},
