  {name: "Camp Bestival 2018", latitude: 50.6371246, longitude: -2.20189370000003, start_date: "2018-07-28", end_date: "2018-07-31", date: "July 28-31, 2018", location: "Dorset, UK", city: "Wareham", state: "Dorset", country: "GB", website: "http://holding.campbestival.net/", description: "It's inspired by the halcyon days of summers past, imagine the 1950s british holiday camp with a twist and you'll get close to what camp bestival is all about. expect to bask in nostalgia and fits of giggles as the bestival bluecoats, with the mighty miguel from the cuban brothers at the helm, lead you on a merry jaunt around the most beautiful site in the world designed by josie da bank.", price: 0, camping: " Yes"},
