  {name: "Floydfest 2018", latitude: 36.8317936, longitude: -80.3487204, start_date: "2018-07-27", end_date: "2018-07-31", date: "July 27-31, 2018", location: "Floyd, VA", city: "Floyd", state: "VA", country: "US", website: "http://floydfest.com/", description: "The homegrown floydfest has only one modest aim: “our mission is to the be the best music experience of our time.” the lofty promise is generating results as each year the lineup gets deeper and the names get bigger. the famous blue ridge parkway serves as your living room for the weekend.", price: 0, camping: " Yes"},
