  {name: "Oregon Jamboree 2018", latitude: 44.3976247, longitude: -122.7361959, start_date: "2018-07-29", end_date: "2018-07-31", date: "July 29-31, 2018", location: "Sweet Home, OR", city: "Sweet Home", state: "OR", country: "US", website: "http://oregonjamboree.com/", description: "Nestled in the foothills of the scenic cascade mountains, the oregon jamboree is held on 20+ acre park-like setting that includes the historic weddle covered bridge. the jamboree offers a full festival atmosphere in the main venue and a more intimate concert experience on the second stage in sankey park. in addition to featured headline entertainment, this family-style event hosts rv and tent camping, food booths, beer & wine gardens, and a variety of other attractions.", price: nil, camping: " Yes"},
