  {name: "Mountain Home 2018", latitude: 43.1329504, longitude: -115.6911975, start_date: "2018-07-29", end_date: "2018-07-31", date: "July 29-31, 2018", location: "Mountain Home, ID", city: "Mountain Home", state: "ID", country: "US", website: "http://mountainhomefestival.com/", description: nil, price: 0, camping: " Yes"},
  {name: "Lollapalooza Chicago 2018", latitude: 41.8741516, longitude: -87.6208061, start_date: "2018-07-28", end_date: "2018-07-31", date: "July 28-31, 2018", location: "Chicago, IL", city: "Chicago", state: "IL", country: "US", website: "http://www.lollapalooza.com/", description: "It’s loud. it’s messy. it’s lollapalooza. you got to hand it perry farrell, the bizarre and quirky visionary who reinvented the american music festival with lollapalooza first taking it on the road in the last century and then putting down stakes in chicago. despite a firm homebase in the windy city, lolla hasn’t forgotten its traveling roots with editions in south america and europe. ", price: nil, camping: " No"},
