  {name: "Belladrum Tartan Heart Festival 2018", latitude: 57.483411, longitude: -4.46035099999995, start_date: "2018-08-04", end_date: "2018-08-06", date: "August 4-6, 2018", location: "Beauly, Scotland", city: "Beauly", state: "Highland", country: "GB", website: "http://www.tartanheartfestival.co.uk/", description: nil, price: 0, camping: " Yes"},
