  {name: "The Werk Out 2018", latitude: 39.896454, longitude: -82.4201539, start_date: "2018-08-04", end_date: "2018-08-06", date: "August 4-6, 2018", location: "Thornville, OH", city: "Thornville", state: "OH", country: "US", website: "http://www.thewerkoutfestival.com/site/", description: "The festival brings awareness to musical styles that are the backbone of the vibrant music scene in the midwest. it serves as showcase in a shared playground between artist and participant and draws people from all across the united states. the festival is the of the product of the band, the werks, funky bean productions and alchemyhouse presents.", price: 0, camping: " Yes"},
  {name: "Cambridge Rock Festival 2018", latitude: 52.196117, longitude: 0.069308699999965, start_date: "2018-08-04", end_date: "2018-08-07", date: "August 4-7, 2018", location: " Cambridge, UK", city: "Cambridge", state: "Cambridgeshire", country: "GB", website: "http://cambridgerockfestival.co.uk/", description: "A superb rock festival featuring mainly rock and blues, with added prog, nwbhm, great food and 70 real ales, ciders, wines and lager! camping and caravanning available over the full festival. just 2.5 miles from the historic centre of cambridge and 3.3miles from cambridge rail station. ", price: 0, camping: " Yes"},
  {name: "IleSoniq 2018", latitude: 45.5024107880138, longitude: -73.527087237793, start_date: "2018-08-05", end_date: "2018-08-06", date: "August 5-6, 2018", location: "Montreal, QC", city: "Montreal", state: "QC", country: "CA", website: "http://www.ilesoniq.com/", description: nil, price: nil, camping: " No"},
