  {name: "Dancefestopia 2018", latitude: 39.1041725, longitude: -94.5998517, start_date: "2018-09-09", end_date: "2018-09-11", date: "September 9-11, 2018", location: "Kansas City, MO", city: "Kansas City", state: "MO", country: "US", website: "http://www.dancefestopia.com", description: "Dancefestopia 2014 presents an enhanced high-energy lineup with the biggest names in the music industry. prepare for a sensory overload as the stages light up the sky and performers rock the crowd.", price: 0, camping: " Yes"},
  {name: "Pop Montreal 2018", latitude: 45.5016889, longitude: -73.567256, start_date: "2018-09-21", end_date: "2018-09-25", date: "September 21-25, 2018", location: "Montreal, QC", city: "Montreal", state: "QC", country: "CA", website: "http://popmontreal.com/", description: "Wonderfully weird and beautifully under-appreciated, pop montreal is your best excuse to visit the city in the fall. venues are scattered across the city from the largest clubs to unique venues (parks and cathedrals) to a single dude singing in the back of a vintage clothing store. and when you need a break from the crowds and music, it’s easy to slip into one of montreal’s amazing restaurants or bars.  ", price: nil, camping: " No"},
  {name: "Austin City Limits 2018", latitude: 30.266962, longitude: -97.772859, start_date: "2018-09-30", end_date: "2018-10-09", date: "September 30-October 9, 2018", location: "Austin, TX", city: "Austin", state: "TX", country: "US", website: "http://www.aclfestival.com/", description: "Named after the venerable pbs series, the austin city limits festival heads into its second decade stronger than ever. the traditional lineup announcement leads to a flurry of praise and criticism from the hip kids, but the love for this festival is so strong that acl added a second weekend.", price: nil, camping: " No"},
