  {name: "Field Trip 2018", latitude: 43.639276, longitude: -79.403029, start_date: "2018-06-04", end_date: "2018-06-05", date: "June 4-5, 2018", location: "Toronto, ON", city: "Toronto", state: "ON", country: "CA", website: "http://fieldtriplife.com/", description: "Field trip began in 2013 as a celebration of arts & crafts' 10th anniversary, but in our second year our sights are squarely on establishing it as a world-class, two-day boutique music and arts festival situated in the heart of downtown toronto. the 2014 edition will unfold across two days, programmed far beyond music to focus on highlighting the community's best culinary offerings, as well as collaborative explorations on the themes of art, photography, technology, fashion and more.", price: 0, camping: " No"},
  {name: "Joshua Tree Fall 2018", latitude: 34.2058757, longitude: -116.2468957, start_date: "2018-10-06", end_date: "2018-10-09", date: "October 6-9, 2018", location: "Joshua Tree, CA", city: "Joshua Tree", state: "CA", country: "US", website: "http://joshuatreemusicfestival.com/index.html", description: "These independently produced music festivals are held annually in the shadows of the infamous national park. they are two (of the very few) multi-day campout music festivals in southern california featuring live music. music lovers of all ages enjoy this phenomenal live music in an intimate setting and magical surroundings. the spring festival features an eclectic line up of performers; dance-world-electro-funk'n groove. the fall fest differs musically with artists of the more rootsicana-newgrassy-folkadelic realms. the two different musical stylings create distinct audiences at the festivals, but many folks do attend both. the town of joshua tree is located in the high desert of the magical mojave, 50 minutes from palm springs, 2.5 hour drive from la, 3 from san diego, 3.5 from vegas, and 5 from phoenix, at the entrance to the world renowned national park. ", price: 0, camping: " Yes"},
