  {name: "Amsterdam Dance Event 2018", latitude: 52.3702157, longitude: 4.89516789999993, start_date: "2018-10-19", end_date: "2018-10-23", date: "October 19-23, 2018", location: "Amsterdam, The Netherlands", city: "Amsterdam", state: "NH", country: "NL", website: "http://www.amsterdam-dance-event.nl/", description: "The amsterdam dance event (ade) is the world's leading electronic music conference and the biggest club festival for the many electronic sub-genres on the planet. the event offers a full program of daytime conferences, including interactive workshops, mentoring sessions, technical demonstrations and in-depth round-table discussions, alongside a nighttime music festival featuring more than 220 events over five days in 52 venues around the city. each year, the ade attracts over 3,000 business professionals and 140,000 festival visitor's including 30,000 tourists - from 62 countries.", price: nil, camping: " No"},
  {name: "Voodoo Experience 2018", latitude: 29.9510658, longitude: -90.0715323, start_date: "2018-10-28", end_date: "2018-10-30", date: "October 28-30, 2018", location: "New Orleans, LA", city: "New Orleans", state: "LA", country: "US", website: "http://worshipthemusic.com/", description: "Every year around halloween, thousands gather in new orleans for the voodoo music experience! this mega-fest features touring bands along with regional favorites.", price: nil, camping: " No"},
  {name: "Iceland Airwaves 2018", latitude: 64.133333, longitude: -21.9333329999999, start_date: "2018-11-02", end_date: "2018-11-06", date: "November 2-6, 2018", location: "Reykjavik, Iceland", city: "Reykjavík", state: nil, country: "IS", website: "http://icelandairwaves.is/", description: "The winter heats up in reykjavik where music festival junkies spend the days taking in the wonders of the island and spending nights at the top clubs in the country. from hipster indie acts to geysers to after-parties, iceland airwaves remains a solid bet for a cold weather festival.", price: nil, camping: " No"},
  {name: "Outlook Festival 2018", latitude: 44.8947794, longitude: 13.8156157999999, start_date: "2018-09-02", end_date: "2018-09-06", date: "September 2-6, 2018", location: "Pula, Croatia", city: "Pula", state: "Istria County", country: "HR", website: "http://www.outlookfestival.com/", description: "Outlook festival is the largest bass music and soundsystem culture festival in europe, featuring the biggest names from the most vibrant and cutting edge dance scenes around.  when we talk about bass music we don’t mean the bastardised commercial version currently being sold to children, we mean underground dancefloor music, whether it be house, techno, dubstep, reggae, dub, hiphop, garage, grime, electronica.", price: 0, camping: " Yes"},
  {name: "Snowglobe 2018", latitude: 38.939926, longitude: -119.9771868, start_date: "2018-12-29", end_date: "2018-01-01", date: "December 29, 2017-January 1, 2018", location: "South Lake Tahoe, CA", city: "South Lake Tahoe", state: "CA", country: "US", website: "http://snowglobemusicfestival.com/", description: "The annual snowglobe in lake tahoe has made good on their promise to bring top-notch edm festival to a ski town. snowglobe is loud. it’s flashy. music shakes your chest. fireworks explode. imagine a club filled with thousands of edm fans dancing and screaming and losing their minds. and it’s outside. in the middle of the winter. ", price: nil, camping: " No"},
