  {name: "Telluride Blues and Brews 2018", latitude: 37.9374939, longitude: -107.8122852, start_date: "2018-09-16", end_date: "2018-09-18", date: "September 16-18, 2018", location: "Telluride, CO", city: "Telluride", state: "CO", country: "US", website: "http://www.tellurideblues.com/", description: "Blues & brews is a three-day celebration of live music and microbrews held at telluride town park, nestled in the valley of stunning 13,000-foot mountain peaks. the festival offers an eclectic mix of live blues, funk, jam band, rock, gospel and soul performances, and some of the best microbreweries in the country, with a wide variety of food and craft vendors, children's activities, late night shows, and much more.", price: nil, camping: " Yes"},
  {name: "Fool’s Paradise 2018", latitude: 29.9012437, longitude: -81.3124341, start_date: "2018-04-01", end_date: "2018-04-02", date: "April 1-2, 2018", location: "St. Augustine, FL", city: "Saint Augustine", state: "FL", country: "US", website: "http://www.foolsparadisefl.com/", description: "Fool’s paradise is bringing your favorite bands to the beach. for two full days, there will be genre-bending music, artist-led excursions, musical workshops, yoga and activities just steps from the ocean.  in addition, a number of late night shows will be hosted by some of the most talented musicians in the industry! ", price: 0, camping: " Yes"},
  {name: "Desert Hearts 2018", latitude: 33.2552896, longitude: -116.5636287, start_date: "2018-04-01", end_date: "2018-04-04", date: "April 1-4, 2018", location: "Los Coyotes Indian Reservation, CA", city: "Ranchita", state: "CA", country: "US", website: "http://www.deserthearts.us/", description: "Desert hearts is a bi-annual music and arts festival. we are a community, a movement of love celebrating life with beats. a place where acceptance, creativity and passions flourish. we are an intimate gathering of open-minded and like-minded individuals where friendships blossom and smiles surround you. a place to learn, grow, inspire and release. a safe haven away from babylon where everyone can connect with nature, be themselves and do what makes then happy. one stage, one vibe, and one beautiful growing family.   house, techno and love was the foundation for our first small renegade in the mojave and has continued to be the basis for our gatherings. we have come a long way since the birth of desert hearts and although our family has grown, our vibe and high standard of music has stayed true to our values.", price: 0, camping: " Yes"},
  {name: "Euphoria Festival 2018", latitude: 30.22734, longitude: -97.66121, start_date: "2018-04-07", end_date: "2018-04-10", date: "April 7-10, 2018", location: "Austin, TX", city: "Austin", state: "TX", country: "US", website: "http://www.euphoriafest.com/#2015", description: "The multi-stage festival with camping options will be held at carson creek ranch, one of the oldest existing ranches in texas, consisting of two 20 acre pastures, separated by carson creek on the banks of the colorado river. conveniently located just minutes from downtown austin, the grounds provide a picturesque camping setting while still being close to the comforts of the city. continuing its pledge to provide the concertgoer with an improved overall festival experience, euphoria will be building upon previous years, including cutting edge visuals, unique stage design, improved dance tents, artist workshops, featuring a diverse range of artists, interactive experiential installations and special late night silent disco shows on friday and saturday. additionally, the festival will expand to include camping options, which will provide campers with early access to the venue, morning yoga, meditation, day concessions, and increased venue facilities.", price: 0, camping: " Yes"},
  {name: "Mission Creek Festival 2018", latitude: 41.6611277, longitude: -91.5301683, start_date: "2018-04-05", end_date: "2018-04-10", date: "April 5-10, 2018", location: "Iowa City, IA", city: "Iowa City", state: "IA", country: "US", website: "http://www.missionfreak.com/", description: "Mission creek festival is a week-long experience that takes over the venues and spaces of downtown iowa cityÂ€”creating an easily navigated nexus of music, literature, food and art. as with past festivals, the upcoming event will feature a strong balance of national, international and regional musicians, writers and artists performing and exhibiting their work in downtown venues like the englert theatre, the mill, blue moose tap house, public space one, gabe's, the yacht club, prairie lights and many other traditional and non-traditional venues.", price: 0, camping: " No"},
  {name: "Bestival Toronto 2018", latitude: 43.6669549, longitude: -79.3118338, start_date: "2018-06-11", end_date: "2018-06-12", date: "June 11-12, 2018", location: "Toronto, ON", city: "Toronto", state: "ON", country: "CA", website: "http://bestival.ca/", description: "Featuring bestival friends old and new, and a healthy dose of kick-ass acts from the uk, canada and worldwide, nurturing the freshest, new, local talent, and showcasing some world famous showstoppers, it’s a statement of intent; and that intent is to party all weekend long! so much more than just a music festival, bestival will be a creative wonderland set upon the iconic and picturesque hanlan’s point beach, toronto island", price: nil, camping: " No"},
  {name: "Nuits Sonores 2018", latitude: 45.764043, longitude: 4.83565899999996, start_date: "2018-05-04", end_date: "2018-05-08", date: "May 4-8, 2018", location: "Lyon, France", city: "Lyon", state: "Rhône", country: "FR", website: "http://www.nuits-sonores.com/en/", description: "Nuits sonores is a french festival entirely dedicated to electronic, independent, visual and digital cultures where music, design, graphic arts and architecture are intimately connected. each year, the festival transforms about 40 locations across the city.  since the festival’s beginnings, over 250 locations in lyon have been used and redesigned including art galleries, industrial wastelands, rooftops and even swimming pools. this has always encouraged the public to explore and discover the festival by foot, bike or using public transport. nuits sonores aims to decode past, present and future innovative cultures. this unique and curious mind-set brings together headliners and rising talent, popular music and niche music from local, national and international scenes.", price: 82, camping: " No"},
  {name: "Bristol Folk Festival 2018", latitude: 51.4538242, longitude: -2.603207, start_date: "2018-04-30", end_date: "2018-05-01", date: "April 30-May 1, 2018", location: "Bristol, UK", city: "Bristol", state: "City of Bristol", country: "GB", website: "http://bristolfolkfestival.co.uk/", description: nil, price: nil, camping: " No"},
  {name: "The Rock Boat 2018", latitude: 27.950575, longitude: -82.4571776, start_date: "2018-02-10", end_date: "2018-02-15", date: "February 10-15, 2018", location: "Tampa, FL", city: "Tampa", state: "FL", country: "US", website: "http://www.therockboat.com/", description: "The rock boat is back for its 16th voyage! we invite you to join us on a 5-day musical adventure january 26-31, 2017. set sail aboard norwegian pearl as we head from miami to costa maya and grand cayman.", price: nil, camping: " No"},
  {name: "Treefort Music Festival 2018", latitude: 43.6187102, longitude: -116.2146068, start_date: "2018-03-23", end_date: "2018-03-27", date: "March 23-27, 2018", location: "Boise, ID", city: "Boise", state: "ID", country: "US", website: "http://treefortmusicfest.com/#/", description: "Boise in idaho may sound like an odd city choice for an epic festival, but the treefort festival continues to impress us year after year. treefort typically takes place the week after sxsw to take advantage of artists heading back to the northwest. short lines and a welcoming city continually keeps treefort at the top of our list. since their inception, the festival has grown in size to include film, yoga, beer, and comedy. ", price: 0, camping: " No"},
  {name: "Further Future 2018", latitude: 36.1699412, longitude: -115.1398296, start_date: "2018-04-29", end_date: "2018-05-01", date: "April 29- May 1, 2018", location: "Las Vegas, NV", city: "Las Vegas", state: "NV", country: "US", website: "http://www.furtherfuture.com/", description: "Further future was founded by the crew that created robot heart, a pioneering, cultural force within the electronic music community. moving beyond the confines of a traditional music festival, further future seeks to bring together world-class musicians and artists, alongside inspiring thought leaders in the areas of science, entrepreneurship, innovation, and technology with a goal of creating a community of like minded individuals open to cultural exploration and change.", price: nil, camping: " Yes"},
  {name: "Levitation 2018", latitude: 30.22734, longitude: -97.66121, start_date: "2018-04-29", end_date: "2018-05-01", date: "April 29-May 1, 2018", location: "Austin, TX", city: "Austin", state: "TX", country: "US", website: "http://www.austinpsychfest.com/", description: "Levitation, formally austin psych fest was founded in 2008. over the years, this independent festival has grown from a small word-of-mouth event to an internationally acclaimed, full weekend event that attracts attendees from all over the world. we are humbled and honored each year to host many of our favorite artists and an amazing community of music lovers from all over. ", price: 0, camping: " Yes"},
  {name: "Blue Ox Music Festival 2018", latitude: 44.811349, longitude: -91.4984941, start_date: "2018-06-09", end_date: "2018-06-11", date: "June 9-11, 2018", location: "Eau Claire, WI", city: "Eau Claire", state: "WI", country: "US", website: "http://blueoxmusicfestival.com/", description: nil, price: 0, camping: " Yes"},
  {name: "Liverpool Sound City 2018", latitude: 53.4083714, longitude: -2.99157260000004, start_date: "2018-05-28", end_date: "2018-05-29", date: "May 28-29, 2018", location: "LIVERPOOL, UK", city: "Liverpool", state: "Merseyside", country: "GB", website: "http://www.liverpoolsoundcity.co.uk/", description: "Liverpool sound city is the largest international music, digital and film festival and conference in the uk, welcoming over 360 artists, in over 25 venues in liverpool's city centre, with over 40,000 music fans and over 3000 industry professionals. every year we take pride in bringing some of the most exciting breakthrough artists to the festival, giving the city an opportunity to see tomorrows major acts up close and personal, before anyone else.", price: 0, camping: " No"},
  {name: "Orange Warsaw Festival 2018", latitude: 52.158717, longitude: 21.010173, start_date: "2018-06-03", end_date: "2018-06-04", date: "June 3-4, 2018", location: "Warszawa, Poland", city: "Warszawa", state: "mazowieckie", country: "PL", website: "http://orangewarsawfestival.pl/en/", description: "Seventh edition of the festival will surely be remembered as the most important music event in poland in 2014. the festival once again took place at the national stadium but this time lasted three days and artists performed at two stages – orange stage and warsaw stage. another novelty on the festival map was festival city, a special area with plenty of attractions and a food court – offering a variety of different snacks and meals from food trucks to over 110 000 visitors. within the festival city guest could also find rochstar crew tent – the best music club in warsaw.", price: 0, camping: " No"},
  {name: "Taste of Country 2018", latitude: 42.1778661, longitude: -74.2304216, start_date: "2018-06-10", end_date: "2018-06-12", date: "June 10-12, 2018", location: "Hunter Mountain, NY", city: "West Kill", state: "NY", country: "US", website: "http://tasteofcountryfestival.com/", description: "The taste of country music festival is the first and only 3-day country music camping festival in the northeast. the festival features world class entertainment, camping in the renowned terrain of the great northern catskills of greene county, outdoor recreation, top-notch food and beverage service and luxury mountainside accommodations unique to host hunter mountain. the festival has already established itself as a must-do for country music fans because of the powerhouse list of artists that perform.", price: 0, camping: " Yes"},
  {name: "Pouzza Fest 2018", latitude: 45.5016889, longitude: -73.567256, start_date: "2018-05-20", end_date: "2018-05-22", date: "May 20-22, 2018", location: "Montreal, QC", city: "Montreal", state: "QC", country: "CA", website: "http://pouzzafest.com/index.php?p=1/", description: "Pouzza fest is a punk rock music festival set to take place in downtown montreal. over 200 bands will perform in 9 different venues all within walking distance from each other. pouzza fest's goal is to showcase the sense of community which has been at the core of the punk rock scene from its very start. we wish for this event to be a huge party for everyone involved. we want every attendee to be able to see their favorite bands, to discover new ones, to meet new friends and to experience an all-around unique weekend in the wonderful setting that is montreal.", price: 0, camping: " No"},
  {name: "Sound City 2018", latitude: 53.4083714, longitude: -2.99157260000004, start_date: "2018-05-28", end_date: "2018-05-29", date: "May 28-29, 2018", location: "Liverpool, UK", city: "Liverpool", state: "Merseyside", country: "GB", website: "http://www.liverpoolsoundcity.co.uk/", description: "Liverpool sound city is the largest international music, digital and film festival and conference in the uk, welcoming over 360 artists, in over 25 venues in liverpool's city centre, with over 40,000 music fans and over 3000 industry professionals. every year we take pride in bringing some of the most exciting breakthrough artists to the festival, giving the city an opportunity to see tomorrows major acts up close and personal, before anyone else.", price: 0, camping: " No"},
  {name: "Found Festival 2018", latitude: 51.4510451, longitude: -0.104584700000032, start_date: "2018-06-11", end_date: "2018-06-11", date: "June 11, 2018", location: "London, UK", city: "London", state: "Greater London", country: "GB", website: "http://foundfestival.com/", description: "London’s premier electronic music festival returns for a third year. in 2015 found presents the planet’s finest purveyors of house & techno. the programme of electronic stalwarts and cutting edge artists looks to the uk, europe and further afield, with a presentation of five carefully curated stages at our new south london home, brockwell park, brixton.", price: 0, camping: " No"},
  {name: "Riverbend Festival 2018", latitude: 35.0456297, longitude: -85.3096801, start_date: "2018-06-10", end_date: "2018-06-18", date: "June 10-18, 2018", location: "Chattanooga, TN", city: "Chattanooga", state: "TN", country: "US", website: "http://www.riverbendfestival.com/", description: "The riverbend festival is an internationally award winning 9 day music festival located in the heart of chattanooga, tennessee. boasting five stages with over 100 bands featuring world class entertainment ranging from classic rock, jam bands, country, urban and bluegrass! riverbend draws over 650,000 patrons annually. enjoy the children's village, mobile exhibits, bluecross riverbend run and walk, marketplace, fireworks finale and more.", price: 0, camping: " No"},
  {name: "Down The Rabbit Hole 2018", latitude: 51.8476637, longitude: 5.69164810000007, start_date: "2018-06-24", end_date: "2018-06-26", date: "June 24-26, 2018", location: "Beuningen, Netherlands", city: "Ewijk", state: "GE", country: "NL", website: "http://downtherabbithole.nl/", description: nil, price: 0, camping: " Yes"},
  {name: "Best Kept Secret Festival 2018", latitude: 51.5282752, longitude: 5.12475519999998, start_date: "2018-06-17", end_date: "2018-06-19", date: "June 17-19, 2018", location: "Hilvarenbeek, The Netherlands", city: "Hilvarenbeek", state: "NB", country: "NL", website: "http://www.bestkeptsecret.nl/", description: "Best kept secret festival focuses 100% on music, with a strong, sharp line-up in which big names are alternated with many new discoveries from indie, folk, hip-hop, rock, electronics or a mixture of styles. the gorgeous festival site with forests, beach, swimming water, nearby holiday park and campsite, excellent food and drinks all contribute to our goal: your perfect festival. the third edition has one open air stage (one), three tent stages (two, three and five) and one different stage: four. this last stage will be hosted by dj st. paul. every day he invites some guest-dj’s who will play their own set. in total, around 85 artists, bands and dj’s will perform at best kept secret festival 2015.", price: 0, camping: " Yes"},
  {name: "Hideout Festival 2018", latitude: 44.5561811, longitude: 14.8854242, start_date: "2018-06-26", end_date: "2018-06-30", date: "June 26-June 30, 2018", location: "Pag, Croatia", city: "Novalja", state: "Lika-Senj County", country: "HR", website: "http://www.hideoutfestival.com/", description: "Entering into its fifth year, hideout is one of the leading electronic music festivals in the summer calendar and this year, it celebrates five years of unforgettable parties.  set in the intimate surroundings of zrce beach on the island of pag, the festival site is sandwiched between mountains,  trees and the adriatic sea.", price: 0, camping: " Yes"},
  {name: "Escapade 2018", latitude: 45.4215296, longitude: -75.6971931, start_date: "2018-06-25", end_date: "2018-07-01", date: "June 25- July 1, 2018", location: "Ottawa, ON", city: "Ottawa", state: "ON", country: "CA", website: "http://www.escapademf.com", description: "Escapade music festival is the first festival of its kind in the ncr. it's a festival dedicated to the development of the electronic music scene movement and demographic in the greater ottawa area. escapade music festivalâ€™s goals are to produce a festival during canada day that is unrivalled in the country by combining the following items; most sought after international talent, best and most accomplished local talent, over the top production, great service, amazing ambiance and most of all, an experience that will excite all your senses whether it be visually, auditory or by touch by creating different â€œwowâ€\u009D factors that will keep every person in the audience wanting more.", price: 0, camping: " No"},
  {name: "Great Blue Heron Festival 2018", latitude: 42.1592235, longitude: -79.5953258, start_date: "2018-07-01", end_date: "2018-07-03", date: "July 1-3, 2018", location: "Sherman, NY", city: "Sherman", state: "NY", country: "US", website: "http://www.greatblueheron.com/", description: "The great blue heron music festival delivers an eclectic musical lineup that delights music lovers of all ages. gbh is hosted on an organic farm in rural western new york state that offers clean air, clean water and lots of woodlands, pastures & shade. a community of 7000 friendly people saying \"happy heron” comes together annually to celebrate life, to enjoy music & to dance! three days and nights are filled with national and regional acts on three stages highlighting americana roots, rock, reggae, zydeco, swing, old time, hip-hop, celtic and bluegrass styles. families will enjoy our kids’ tent, teen tent and instrument and healing arts workshops and fire circle. the blue heron has been a homecoming for many since it's beginnings in 1992. gbh is completely patron-sponsored, no corporate hype anywhere to be found at this gathering.   patrons can camp overnight all weekend or visit just for the day.", price: 0, camping: " Yes"},
  {name: "OpenAir St. Gallen 2018", latitude: 47.4179284, longitude: 9.36439680000001, start_date: "2018-06-30", end_date: "2018-07-03", date: "June 30-July 3, 2018", location: "St. Gallen, Switzerland", city: "Saint Gallen", state: "SG", country: "CH", website: "http://www.openairsg.ch/", description: "The openair st.gallen is one of the oldest outdoor festivals in switzerland. it's close to the city and it's the second biggest festival in the german part of the country (30,000 capacity per day). the camping site is included in the festival area and no boundaries between sleeping and going to the shows. if you're lucky you'll be able to see your favorite band perform on stage while you're relaxing in front of your tent. this is something that makes the openair st.gallen very special, besides the unique setting in the valley of the river sitter surrounded by trees.", price: 0, camping: " Yes"},
  {name: "Ruisrock 2018", latitude: 60.4518126, longitude: 22.2666303, start_date: "2018-07-08", end_date: "2018-07-10", date: "July 8-10, 2018", location: "Turku, Finland", city: "Turku", state: nil, country: "FI", website: "http://www.ruisrock.fi/", description: "Ruisrock is finland's largest rock festival held annually in turku, finland during the first weekend of july. ruisrock, founded in 1970, is the second oldest rock festival in europe and the oldest in finland. the festival is held in the beautiful ruissalo island by the baltic sea surrounded by nature reserve. the festival is located 5 km from turku town centre and is easily accessible by festival shuttle bus. ruisrock festival has attracted tens of thousands of visitors to enjoy the festival atmosphere for 44 consecutive years. each year the festival hosts both local top artists and international stars.", price: 135, camping: " Yes"},
  {name: "Balaton Sound 2018", latitude: 46.8840799, longitude: 17.9580946999999, start_date: "2018-07-06", end_date: "2018-07-10", date: "July 6-10, 2018", location: "Zamardi, Hungary", city: "Zamárdi", state: "Somogy County", country: "HU", website: "http://www.balatonsound.com/", description: "Seaside lounges, restaurants, bars and anything you need to enjoy the balaton sunset, plus a great number of stars on several stages, that’s the already beloved concept of balaton sound. the event attracts approx. 100 000 visitors each year and turns zamárdi, a small town on the southern shores of lake balaton into a massive party arena. the festival’s venue is a picturesque beach resort at the biggest lake of central europe, also regarded as a touristic center of the region.", price: 0, camping: " Yes"},
  {name: "Fresh Island Festival 2018", latitude: 44.443803, longitude: 15.055404, start_date: "2018-07-12", end_date: "2018-07-14", date: "July 12-14, 2018", location: "Pag Island, Croatia", city: "Pag", state: "Zadar County", country: "HR", website: "http://2014.fresh-island.org/home", description: "Launched in 2012, new yorker fresh island festival immediately established itself as one of europe’s top summer getaways for those who want to enjoy a fusion of both warm weather activities and exclusive hip-hop and r&b concerts. ", price: nil, camping: " No"},
  {name: "Brooklyn Hip Hop Festival 2018", latitude: 40.71427, longitude: -74.00597, start_date: "2018-07-13", end_date: "2018-07-16", date: "July 13-16, 2018", location: "Brooklyn, NY", city: "New York", state: "NY", country: "US", website: "http://www.bkhiphopfestival.com/", description: "As new york city's largest hip-hop cultural event, the festival showcases the positive aspects of hip-hop culture by highlighting hip-hop's legacy as an agent of artistic progression, community building and social change. bhf 2012 events will continue to reflect the full range of hip-hop culture, which spans music, film, academics, grassroots empowerment and more.", price: nil, camping: " No"},
  {name: "Nozstock The Hidden Valley 2018", latitude: 52.190713, longitude: -2.50872000000004, start_date: "2018-07-22", end_date: "2018-07-24", date: "July 22-24, 2018", location: "Herefordshire, UK", city: "Bromyard", state: "Herefordshire", country: "GB", website: "http://www.nozstock.com/", description: "A festival built from a curious amalgamation of performance, art, electronic supersounds and good old-fashioned guitar-strumming and drum-bashing.", price: nil, camping: " Yes"},
  {name: "Cambridge Folk Festival 2018", latitude: 52.205337, longitude: 0.121816999999965, start_date: "2018-07-28", end_date: "2018-07-31", date: "July 28-31, 2018", location: "Cambridge, UK", city: "Cambridge", state: "Cambridgeshire", country: "GB", website: "http://www.cambridgefolkfestival.co.uk/", description: "The festival is renowned for its unique atmosphere and an eclectic mix of music and a wide definition of what might be considered folk. the best traditional folk artists from the uk and ireland rub shoulders with cutting edge contemporary acts, the finest american country, blues and roots artists, acclaimed singer songwriters and world famous names. bluegrass, gospel, cajun, zydeco, jazz, world, klezmer and ceilidhs are also regular features. the line up has reflected the many changes in the music scene from the 60s to the present and is always a hotbed mix of the old and the new.", price: 0, camping: " Yes"},
  {name: "Vertex Festival 2018", latitude: 38.8422178, longitude: -106.1311288, start_date: "2018-08-05", end_date: "2018-08-07", date: "August 5-7, 2018", location: "Buena Vista, CO", city: "Buena Vista", state: "CO", country: "US", website: "http://www.vertexfestival.com/", description: "Vertex’s vision is inspired by its majestic high elevation home where sky meets peaks, peaks meet valleys, and valleys meet rivers. the venue is nestled in sprawling rangeland at the foot of the continental divide and surrounded by the year-round snowcapped 14,000-foot peaks of the collegiate mountain range. the festival site is known as cottonwood meadows, a recently revitalized working ranch located a mile from downtown buena vista, colorado in chaffee county. ", price: nil, camping: " Yes"},
  {name: "Green Man Festival 2018", latitude: 51.883333, longitude: -3.39999999999998, start_date: "2018-08-18", end_date: "2018-08-21", date: "August 18-21, 2018", location: "Brecon Beacons, Wales", city: "Brecon", state: "Powys", country: "GB", website: "http://www.greenman.net/", description: "With ten entertainment areas in lush welsh wilderness, 24 hour entertainments, comedy, poetry, literature, art & science, fun for 12 and unders and a separate area just for teens, spas, therapies, hot piping showers, local ale and cider sipping, all night bonfires, gorgeous selection of locally sourced food over 4 days of festival fun, the award winning green man really has got it all.", price: 0, camping: " Yes"},
  {name: "The Wickerman Festival 2018", latitude: 54.8176583, longitude: -3.92725210000003, start_date: "2018-07-22", end_date: "2018-07-23", date: "July 22-23, 2018", location: "Dundrennan, Scotland", city: "Kirkcudbright", state: "Dumfries and Galloway", country: "GB", website: "http://www.thewickermanfestival.co.uk/", description: "Wickerman is one of the uks best-loved independent music festivals and is now entering its 13th consecutive year. with ten stages featuring an eclectic and exciting mix of leading artists, alternative acts and up-and-coming talent, the two day summer party caters for all musical tastes. the wickerman site is a wonderland for adults and children alike with a cinema, fun fair, circus entertainment, segway hire, mountain biking and array of arts and craft activities scattered throughout its fields. high quality yurts, tipis and cloud houses and spacious campsites complete the magical festival experience. every year the festival stages an unforgettable finale, as thousands of fans flock to watch a towering 40ft wickerman be spectacularly set alight.", price: 0, camping: " Yes"},
  {name: "Arise Music Festival 2018", latitude: 40.448109, longitude: -105.219132, start_date: "2018-08-05", end_date: "2018-08-07", date: "August 5-7, 2018", location: "Loveland, CO", city: "Loveland", state: "CO", country: "US", website: "http://www.arisefestival.com", description: "Located in loveland, colorado the arise music festival features 3 days of music, yoga, workshops and co-creative experiences of all kinds. surrounded by national forest, the festival takes place at sunrise ranch – an oasis in the heart of colorado’s legendary front range. featuring sweeping vistas and beautiful meadows, this magical and secluded landscape is a perfect container for participants to entertain and be entertained, be inspired, explore their creative potentials, connect with nature, stretch out, dive in, and get down.", price: 0, camping: " Yes"},
  {name: "Bloodstock 2018", latitude: 52.7354375, longitude: -1.69607240000005, start_date: "2018-08-11", end_date: "2018-08-14", date: "August 11-14, 2018", location: "Derbyshire, UK", city: "Swadlincote", state: nil, country: "GB", website: "http://www.bloodstock.uk.com/", description: "Bloodstock boasts over 100 international rock and metal acts across four stages, as well as other attractions including a huge international metal market, late night entertainment in the sophie lancaster tent, fairground rides, ‘the bloodstock arms’ festival bar serving real ale, full weekend camping and one of the best atmospheres the festival scene has to offer. add to this a signing tent where you can meet your favourite bands, and for those of you who need those extra creature comforts - an extra special vip experience in the serpents lair camping and hospitality backstage bar, which offers 80+ different real ales, this really is an unmissable date in the headbangers calendar. metal brethren at your marks!", price: 0, camping: " Yes"},
  {name: "Salmon Arm Roots & Blues 2018", latitude: 50.7001034, longitude: -119.2838443, start_date: "2018-08-19", end_date: "2018-08-21", date: "August 19-21, 2018", location: "Salmon Arm, BC", city: "Salmon Arm", state: "BC", country: "CA", website: "http://www.rootsandblues.ca/", description: "The festival features a profusion of roots, blues, folk, dance, and world music on five outdoor stages. also featured: beer gardens with stage views, global food village, artisan market, workshops, family fun zone (kids 12 and under free).  the salmon arm roots and blues festival has become one of the best festivals in western canada and now includes a week of pre-fest satellite concerts under our outreach project, routes & blues. come and experience the beautiful bc interior and make the festival one of your stops.", price: 0, camping: " Yes"},
  {name: "Burning Man 2018", latitude: 40.910733, longitude: -119.0560102, start_date: "2018-08-28", end_date: "2018-09-05", date: "August 28- September 5, 2018", location: "Black Rock Desert, NV", city: "Black Rock Desert", state: "NV", country: "US", website: "http://burningman.com/", description: "Trying to explain what burning man is to someone who has never been to the event is a bit like trying to explain what a particular color looks like to someone who is blind. there are no rules about how one must behave or express oneself at this event (save the rules that serve to protect the health, safety, and experience of the community at large); rather, it is up to each participant to decide how they will contribute and what they will give to this community. the event takes place on an ancient lakebed, known as the playa. by the time the event is completed and the volunteers leave, sometimes nearly a month after the event has ended, there will be no trace of the city that was, for a short time, the most populous town in the entire county.", price: nil, camping: " Yes"},
  {name: "Shiprocked 2018", latitude: 25.7616798, longitude: -80.1917902, start_date: "2018-01-16", end_date: "2018-01-20", date: "January 16-20, 2018", location: "Miami, Fl", city: "Miami", state: "FL", country: "US", website: "http://www.shiprocked.com/", description: "The ultimate rock music cruise vacation is produced by alan koenig of ask4 entertainment. during shiprocked 2015, guests from around the u.s. and various other countries were treated to more than 50 performances from 25 artists on five stages aboard norwegian pearl--and on the spectacular beach stage of great stirrup cay in the bahamas--along with three days of meet-and-greets with shiprocked artists, comedy and dj sets, impromptu stage-side signings, and more.", price: nil, camping: " No"},
  {name: "FreshGrass Festival 2018", latitude: 42.7020206, longitude: -73.1158742, start_date: "2018-09-16", end_date: "2018-09-18", date: "September 16-18, 2018", location: "North Adams, MA", city: "North Adams", state: "MA", country: "US", website: "http://freshgrass.com/", description: "Freshgrass is a wonderland of traditional and cutting-edge bluegrass, tucked appropriately into a 19th-century factory turned 21st-century museum in the berkshire mountains of northwestern massachusetts. an opportunity for enthusiasts to both appreciate and participate, freshgrass is family-friendly and brimming with the brightest talent not just on our four stages, but also in our galleries, brick-lined courtyards, and grassy fields. ", price: nil, camping: " Yes"},
  {name: "The Great Escape 2018", latitude: 50.82253, longitude: -0.137162999999987, start_date: "2018-05-19", end_date: "2018-05-21", date: "May 19-21, 2018", location: "Brighton, UK", city: "Brighton", state: "The City of Brighton and Hove", country: "GB", website: "http://greatescapefestival.com/", description: "Since being founded in 2006, the great escape has been firmly established internationally as the leading event for showcasing new music. taking place in brighton over 3 days in may, the great escape kicks starts the festival season, introducing 15,000 music lovers to the key artists and sounds of the year. over 300 bands playing in 30 venues over 3 days, pre-publicized performances, and impromptu street gigs spring up all over town. the alternative escape, numerous club nights, label parties, industry showcases, unique collaborations and outdoor gigs all add to the festivities.", price: 0, camping: " No"},
  {name: "Worldwide Festival Sete 2018", latitude: 43.4078758, longitude: 3.70082189999994, start_date: "2018-07-04", end_date: "2018-07-10", date: "July 4-10, 2018", location: "Sete, France", city: "Sète", state: "Hérault", country: "FR", website: "http://www.worldwidefestival.com/", description: "With its unique line-up of artists, the wf aims to welcome festival goers to its exceptional venues in various cities around the world, and to highlight the authenticity and rich culture of these cities. the worldwide festival cultivates this specific aim and offers a unique holiday experience, with the idea being to create several wf events throughout the year in different parts of the world.", price: 0, camping: " No"},
  {name: "Larmer Tree 2018", latitude: 51.068785, longitude: -1.79447200000004, start_date: "2018-07-13", end_date: "2018-07-17", date: "July 13-17, 2018", location: "Salisbury, UK", city: "Salisbury", state: "Wiltshire", country: "GB", website: "http://larmertreefestival.co.uk/", description: "Founded by festival director james shepard in the summer of 1990, a  quarter of a century ago, with an audience of just 100 people and 12   hours of music, 25 years on, larmer tree festival draws in crowds of up   to 5,000 a day for a full five-day extravaganza.  with its eclectic and varied blend of music, comedy and activities  for all ages, this original boutique festival delivers five magical days in   the intimate grounds of larmer tree gardens, near salisbury on the   wiltshire/dorset border.  with six unique stages spread across the festival site, festival-goers can immerse themselves in a variety of music  with well established artists playing alongside emerging talent.", price: 0, camping: " Yes"},
  {name: "Eastern Electrics 2018", latitude: 51.760453, longitude: -0.209227999999939, start_date: "2018-08-06", end_date: "2018-08-06", date: "August 6, 2018", location: "London, UK", city: "Hatfield", state: "Hertfordshire", country: "GB", website: "http://easternelectrics.com/", description: "Undoubtedly one of the biggest all-dayers in the festival calendar, eastern electrics festival has grown into the premier party of the summer for electronic music lovers across the country. returning on saturday august 6th to it’s stunning countryside home at hatfield house, hertford, the eastern electrics family will once again present the cream of the house, techno, garage and bass crop across nine festival stages hosted by the worlds biggest electronic music icons.", price: 0, camping: " No"},
  {name: "Imagine Festival 2018", latitude: 33.7489954, longitude: -84.3879824, start_date: "2018-08-26", end_date: "2018-08-28", date: "August 26-28, 2018", location: "Atlanta, GA", city: "Atlanta", state: "GA", country: "US", website: "http://www.imaginefestival.com/", description: "Combining three beautiful venues – historic fourth ward park, masquerade music park, and clear creek basin -- the annual two-day music event is the first festival of it’s kind conveniently located inside the city of atlanta.", price: 0, camping: " No"},
  {name: "South West Four (SW4) 2018", latitude: 51.457831, longitude: -0.148165000000063, start_date: "2018-08-29", end_date: "2018-08-29", date: "August 29, 2018", location: "London, UK", city: "London", state: "Greater London", country: "GB", website: "http://www.southwestfour.com/", description: "For the very first time sw4 will showcase ten incredible stages across the bank holiday weekend, including the debut of our second main stage, the biggest indoor structure ever erected on clapham common. and with two main stages set to welcome your favourite headline djs and live electronic acts, our lineup will hit the three figure mark for the first time, as we welcome over one hundred artists to the capital. ", price: nil, camping: " No"},
  {name: "Liverpool Psych Fest 2018", latitude: 53.4083714, longitude: -2.99157260000004, start_date: "2018-09-23", end_date: "2018-09-24", date: "September 23-24, 2018", location: "Liverpool, UK", city: "Liverpool", state: "Merseyside", country: "GB", website: "http://www.liverpoolpsychfest.com/", description: "Liverpool international festival of psychedelia is a pan-continental celebration of audio-futurists, operating at the bleeding edge of today’s psychedelic renaissance. for two days each september, liverpool’s former industrial heartland beats once more, to motorik throb and shimmering drone, a kaleidoscopic celebration of our global psychedelic village. the festival was lauded across its first three installments (2012, 2013 and 2014) for its unique take on a thoroughly modern psychedelic condition, with the guardian declaring “liverpool, the great psychedelic capital of europe”.", price: 0, camping: " No"},
  {name: "Punk Rock Bowling NJ 2018", latitude: 40.2203907, longitude: -74.0120817, start_date: "2018-06-11", end_date: "2018-06-12", date: "June 11-12, 2018", location: "Asbury Park, NJ", city: "Asbury Park", state: "NJ", country: "US", website: "https://punkrockbowling.com/", description: "Punk rock bowling & music festival was started back in 1999 by brothers shawn and mark stern, owners of the long standing independent record label byo records, as a way to bring the independent music community together for an annual party. it has since grown into a 5-day festival in downtown las vegas that brings out fans and bands alike from all over the world. 3 days of outdoor festivals, 5 nights of club shows, a 2-day bowling tournament, hotel pool parties, a punk rock poker tournament, movie screenings and comedy shows to boot, all wrapped up into one amazing weekend in the city that never sleeps. and now, we welcome our fans, friends and family to our first trip east, to asbury park as well, in 2017.", price: 0, camping: " No"},
  {name: "Body & Soul Festival 2018", latitude: 53.5272959, longitude: -7.44321680000007, start_date: "2018-06-17", end_date: "2018-06-19", date: "June 17-19, 2018", location: "Westmeath, Ireland", city: "Westmeath", state: nil, country: "IE", website: "http://bodyandsoul.ie/", description: "Dancing under the stars. sparkling conversations in the hot tub. gramophone grooves. acoustic sessions. marshmallows on a bonfire. pop-up performances. twinkling pathways. rejuvenating massage. disco yurts. moonlight masquerade. electronic alcoves. fireworks. candlelit spoken word. four-poster picnics. flamboyant spectaculars. costumes. teacups at breakfast.  body&soul. a festival full of surprises.", price: 0, camping: " Yes"},
  {name: "Metaldays 2018", latitude: 46.1857188, longitude: 13.7319838, start_date: "2018-07-24", end_date: "2018-07-30", date: "July 24-30, 2018", location: "Tolmin, Slovenia", city: "Tolmin", state: "Tolmin", country: "SI", website: "http://metaldays.net/Home", description: "The metaldays festival will present you a friendly and absolutely relaxed atmosphere, perfect for you to just forget about all worries and enjoy your most likely best holiday ever!   the festival is located at sotocje, which lies inbetween the two mountain rivers called tolminka and soca. metaldays has two \"festival-owned\" beaches for you to relax on. but the two rivers aren't the only reason sotocje  is that beautiful: tolmin is located only approx. 65 kilometers off the coast of the mediterranean sea, which really gives you that holiday feel. also the road you're travelling on will lead you through the alps, a scenerie that will astonish both full grown metalheads and families with children alike. the metaldays area is also part of the julijske alpe national parks, and the river soca is one of the cleanest in europe. ", price: 109, camping: " Yes"},
  {name: "Philadelphia Folk Festival 2018", latitude: 40.2907756, longitude: -75.4402993, start_date: "2018-08-18", end_date: "2018-08-21", date: "August 18-21, 2018", location: "Upper Salford Township, PA", city: "Upper Salford Township", state: "PA", country: "US", website: "http://www.pfs.org/folk-festival", description: "The philadelphia folk festival began in 1962 and is the largest and longest-running festival of its kind in the country. the event is unique in that it is presented by a non-profit arts education organization, the philadelphia folksong society, and is operated with the help of 2,500 dedicated volunteers.  since its inception, the philadelphia folk festival has been the primary fund raising event for the philadelphia folksong society. founded as a 501(c) 3 non-profit, educational organization in 1957, pfs provides programs of presentation, education, and participation.", price: 0, camping: " Yes"}
